import React from 'react';
import { Route, Switch } from "react-router-dom";
import logo from './logo.svg';
import './App.css';
import LoginPage from "./Pages/LoginPage"

function App() {
  return (
    <div className="App">
      <Route exact path="/login" component={LoginPage} />
    </div>
  );
}

export default App;
